package operator1;

public class Switchvowel {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		char p='a';
		switch (p) {
		case 't':System.out.println("its a vowel");
		break;
		case 'z':System.out.println("its a not vowel");
		break;
		case 'c':System.out.println("its a vowel");
		break;
		case 'y':System.out.println("its a not vowel");
		break;
		case 'u':System.out.println("its a vowel");
		break;
		default:System.out.println("its a consonant");
		}

	}

}
